import React from "react";

import TableCell from "./tablecell.js";

function TableColumn({ columnID, column }) {
  return (
    <div className="table-column">
      {column == null
        ? "Loading..."
        : column.map((columnID) => (
            <>
              <div className="header-cell">{Object.values(columnID)}</div>
              <TableCell column={column} columnID={columnID} />
            </>
          ))}
    </div>
  );
}

export default TableColumn;
